import { Accordion, AccordionSummary, AccordionDetails, Typography, makeStyles, withStyles, Grid, TextField, FormControl, FormControlLabel, FormLabel, Radio, RadioGroup } from '@material-ui/core'
import { ExpandMore } from '@material-ui/icons'
import React, { Component } from 'react'
import InsurerOverview from './Components/Insurer/InsurerOverview.web'
import LockIcon from '@material-ui/icons/Lock';
import PropTypes from 'prop-types';
import LabelWithIcon from './Components/LabelWithIcon';


export const useStyles: any = (theme: any) => ({
    childAccordion: {
        width: '100%',
        '&>div': {
            boxShadow: 'none',
            width: '100%',
            border: '1px solid #ccc',
            //    padding: '15px',
        }
    },
    lineSaprator:{
        margin: '30px 0px',
    }
})

const useStylesFunction = makeStyles({
    accordianHeading: {
        fontWeight: 600,
        display: 'flex',
        alignItems: 'center',
    },
    lockedAccordion: {
        padding: '6px 10px',
        backgroundColor: '#e9f4f9',
        border: '1px solid #ccc',
        borderRadius: '4px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        margin: '0px 8px',
        '& svg': {
            marginRight: '6px',
        }
    }

})

type accordionTitleProps = {
    title: string,
    // insuranceData: any,
}

const AccordionTitle = (props: accordionTitleProps) => {
    const classes = useStylesFunction()
    return (
        <Typography className={classes.accordianHeading}>
            {props?.title}
            {/* {
                    <div className={classes.lockedAccordion}>
                        <LockIcon /> Please select insurance type to unlock  this fields
                    </div>
            } */}

        </Typography>
    )
}

type MyProps = {
    params: any,
    formType: string,
    changeEdit: () => void,
};

class SalesReview extends Component<MyProps> {
    static propTypes: { classes: any; };
    constructor(props: any) {
        super(props);
        // console.log(this.props.match.params.id)
        // this.handleStorage = this.handleStorage.bind(this);
        this.state = {

        };
    }


    render() {
        const { classes }: any = this.props;
        return (
            <div>

                <Accordion>
                    <AccordionSummary
                        aria-expanded={true}
                        expandIcon={<ExpandMore />}
                        aria-controls="Insurers"
                        id="Insurers"
                    >
                        <AccordionTitle title='Releasing to customer' />
                    </AccordionSummary>
                    <AccordionDetails>
                        {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                        <div className={classes.childAccordion}>
                            <Accordion>
                                <AccordionSummary
                                    aria-expanded={true}
                                    expandIcon={<ExpandMore />}
                                    aria-controls="Insurers"
                                    id="Insurers"
                                >
                                    <AccordionTitle title='Tawuniya' />
                                </AccordionSummary>
                                <AccordionDetails style={{width: '100%'}}>
                                    {/* <CustomDataTable
                                    onClick={() => { console.log("sadbhj") }}
                                /> */}

                                <div style={{width: '100%'}}>
                                    <Grid container spacing={3}>
                                        <Grid item xs={12} sm={4}>
                                            <FormControl>
                                                <LabelWithIcon label={'Quotation received?'} />
                                                <RadioGroup
                                                    row
                                                    aria-labelledby="demo-row-radio-buttons-group-label"
                                                    name="row-radio-buttons-group"
                                                >
                                                    <FormControlLabel value="YES" control={<Radio />} label="Yes" />
                                                    <FormControlLabel value="NO" control={<Radio />} label="No" />
                                                </RadioGroup>
                                            </FormControl>
                                        </Grid>
                                        <Grid item xs={12} sm={4}>
                                            <LabelWithIcon label={'Quotation amount'} />
                                            <TextField
                                                id="outlined-basic"
                                                label=""
                                                variant="outlined"
                                                fullWidth
                                                name='Quotation_amount'
                                                value='C-000001'
                                            // onChange={formik.handleChange}
                                            />
                                        </Grid>
                                        <Grid item xs={12} sm={4}>
                                            <LabelWithIcon label={'Proposal'} />
                                            <TextField
                                                id="outlined-basic"
                                                label=""
                                                variant="outlined"
                                                name='Proposal'
                                                fullWidth
                                                value='C-000001'
                                            // onChange={formik.handleChange}
                                            />
                                        </Grid>
                                    </Grid>

                                    <Grid container spacing={3}>
                                        <Grid item xs={12}>
                                            <TextField
                                                id="outlined-multiline-flexible"
                                                label="Address"
                                                multiline
                                                variant="outlined"
                                                maxRows={10}
                                                rows={7}
                                                fullWidth
                                                required
                                            // value={blockFirstData?.address1}
                                            // onChange={(event: React.ChangeEvent<HTMLInputElement>) => handleInputField(event, enumFormInputs.address1)}
                                            />
                                        </Grid>
                                    </Grid>

                                    <hr className={classes.lineSaprator}/>



                                    </div>
                                </AccordionDetails>
                            </Accordion>
                        </div>

                    </AccordionDetails>
                </Accordion>
            </div>
        )
    }
}

SalesReview.propTypes = {
    classes: PropTypes.object.isRequired,
    // formType: PropTypes.string.isRequired,
    // changeEdit: PropTypes.string.isRequired,
    // params: PropTypes.string.isRequired,
};

export default withStyles(useStyles)(SalesReview)
